import React,{Componet} from "react";
import backendadress from"../../reduser/store";


class Anonse extends Componet{
    state={
        anonselist:[]
    }
    componentDidMount= () =>{
        fetch(backendadress+'/anonse/anoonselist')
        .then(response=>response.json())
        .then(json=>{
            this.setstate({anonselist:json})
        })
        console.log(json);
    }
    render(){
        const{anonselist}=this.state;
        return(
            <div>
                {anonselist[1].title}
            </div>
        )
    }
}
export default Anonse
